webpackJsonp([82464564947179],{1590:function(a,e){a.exports={data:{markdownRemark:{html:'<p>Tujia Street을 이른 아침에 읽으면서 농촌 이야기를 쓰는 것은 "White Deer"와 매우 흡사합니다. 한 마을에서 일어난 변화와 정치적 변화에 따른 사람들의 운명의 변화는 마침내 사람들에게 정치 혁명 하에서 인류가 왜곡되었고, 모든 역사는 다소 터무니없는 것처럼 보였고 다양한 인물의 운명은 역사적인 변화에 있다는 인상을 주었던 것으로 보였다. 전위가 그러한 변화가 일어나지 않는다면 더 좋을 것입니다. 그는 시골 지역에서 많은 야생의 성적인 아이디어를 썼다. 그는 시골에서 튼튼한 삶의 기초를 가지지 못했고 이것이 사실인지 아닌지를 판단 할 수 없었다. 그러나 더 많이 쓰면 고의적 인 흔적이 생깁니다. 그러한 소설들은 자라났다. 바람의 불기 후에, 남겨진 것은 나중에 보일 것이다.</p>\n<p>Wujiaochang하려면 가격이 좀 높은 것으로 보인다. 거리에서 "파도의 소리는 똑같습니다."이것은 아마도 카세트 일뿐입니다. 이 노래의 가사는 약간의 예술적 개념으로 쓰여질 수 있습니다. "오늘의 이야기를 오늘 되풀이 할 수 있습니까?이 오래된 티켓은 여객선에 탑승 할 수 있습니까?"</p>\n<p>S 자영업자 자영업자에게는 새해 첫날로 돌아 가지 않았습니다. 그는 강소에서 상해까지 왔으며 상해에서도 살 수있는 곳으로 생각됩니다. 최근 몇 년 동안 점점 더 많은 사람들이 상하이와 주요 도시에서 일해오고 있으며, 미래의 도시 생활은 외국 사람들과 마찬가지로 많은 논리를 가지고 있습니다. 개발 된 지역은 항상 외부 세계에 매력적입니다. 올해의 "이주 노동자 붐"이 일어나기 시작했습니다. 주요 도시의 역이 과밀되어 전체적인 전략이 필요합니다. 그렇지 않으면 이러한 강한 사회적 압력을 해결할 수 없습니다.</p>\n<p>올림픽 동계 올림픽 개최와 중국 팀이 아직 금메달을 딴 것은 아닙니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0037.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0037.md",frontmatter:{title:"2월 20일 일요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0037.md absPath of file >>> MarkdownRemark"}}}});
